import ReactDOM from "react-dom/client"
import "./style.css"
const root = ReactDOM.createRoot(document.getElementById("root"))


function Navbar(){
    return(
        <nav>
        <h1>Perfumy</h1>
        <ul>
            <li>
              <a> Home | </a></li>
            <li><a>Products | </a></li>
            <li><a>About |</a> </li>
            <li><a>Contact |</a> </li>
        </ul>
        </nav>
    )
}

function Search(){
    return(
        <div className="searchbar">
            <input type="text" placeholder="Search"/>
        </div>

    )
}


root.render(<div><Navbar></Navbar><Search></Search></div>);
